import { title } from "../../../../nextjs-material-kit";

const landingPageStyles = {
    section: {
        padding: "70px 0",
        textAlign: "center"
    },
    title: {
        ...title,
        marginBottom: "1rem",
        marginTop: "30px",
        minHeight: "32px",
        textDecoration: "none"
    },
    description: {
        color: "#999"
    },
    card: {
        maxWidth: 345,
        margin: "20px",
        flexGrow: 1
    }
};

export default landingPageStyles;
